import React from 'react'
import Form  from 'react-bootstrap/Form';

export default function PaymentScreen() {
  return (
     <Form>
        <Form.Check
            label="Paypal"
            name="group1"
            type='radio'
            id={`inline-1`}
          />
          
          <Form.Check
            label="Stripe"
            name="group1"
            type='radio'
            id={`inline-2`}
          />
          
     </Form>

  )
}
